    Show: function(callback) {
        // prepare it
        var self = WarnHelper;
        if(!self.injected) {
            self.injected = true;
            self.injectCSS();
            self.injectHTML();
        }
        // show it
        $("#triggerwarn").addClass("show");
        // wait some time
        setTimeout(() => {
            // hide it & wait again
            $("#triggerwarn").removeClass("show");
            setTimeout(() => {
                // call next
                callback();
            }, this.animationSeconds * 1000);
        }, this.waitSeconds * 1000);
    }
